import React from 'react';
import Card from 'react-bootstrap/Card';

export const Home = () => (
<Card>
  <Card.Body>Home</Card.Body>
</Card>,

  <Container fluid>
    <Row>
      <Col>1 of 1</Col>
    </Row>
  </Container>
)
